The run_exec_loop method holds the frame stack loop: fn run_exec_loop( &mut self, evm: &mut Self::Evm, frame: Self::Frame,
) -> Result<FrameResult, Self::Error> { let mut frame_stack = vec![frame]; loop { let current_frame = frame_stack.last_mut().unwrap(); let call_or_result = self.frame_call(current_frame, evm)?; let result = match call_or_result { ItemOrResult::Item(new_frame_input) => { // Create new nested frame and push it on the stack match self.frame_init(current_frame, evm, new_frame_input)? { ItemOrResult::Item(new_frame) => { frame_stack.push(new_frame); continue; } ItemOrResult::Result(res) => res, } } ItemOrResult::Result(res) => { // Frame finished, pop from stack and handle result frame_stack.pop(); res } }; if let Some(parent_frame) = frame_stack.last_mut() { // Send result back to parent frame self.frame_return_result(parent_frame, evm, result)?; } else { // No more frames, execution complete return Ok(result); } }
}

