The central piece is the Host trait defined around the ContextTr abstraction we met earlier. Here's a simplified overview showing how Host methods delegate to the parts inside Context: pub trait Host { // Block info fn basefee(&self) -> U256; // Transaction info fn caller(&self) -> Address; // State access fn sload(&mut self, address: Address, key: U256) -> Option<StateLoad<U256>>; fn sstore(&mut self, address: Address, key: U256, value: U256) -> Option<StateLoad<SStoreResult>>; // Logs & selfdestruct fn log(&mut self, log: Log); fn selfdestruct(&mut self, address: Address, target: Address) -> Option<StateLoad<SelfDestructResult>>;
} // Implementation for any ContextTr type
