The heart of gas management is the Gas struct (in crates/interpreter/src/gas.rs). Here’s a simplified look: #[derive(Default)]
pub struct Gas { limit: u64, remaining: u64, refunded: i64,
} impl Gas { // Create new Gas tracker with limit and remaining gas set to limit pub fn new(limit: u64) -> Self { Self { limit, remaining: limit, refunded: 0, } } // Record spending gas // Returns false if not enough gas remains pub fn record_cost(&mut self, cost: u64) -> bool { if let Some(new_remaining) = self.remaining.checked_sub(cost) { self.remaining = new_remaining; true } else { false } } // Record a gas refund (can be negative sometimes) pub fn record_refund(&mut self, refund: i64) { self.refunded += refund; } // Calculate gas spent minus refunded (refund capped internally) pub fn spent_sub_refunded(&self) -> u64 { let spent = self.limit.saturating_sub(self.remaining); spent.saturating_sub(self.refunded as u64) }
} Meaning: limit: Total gas allowed. remaining: Gas left to spend. refunded: Gas to give back after execution. The record_cost function tries to spend gas and returns if it succeeded or not. Refunds accumulate during execution and adjust net gas spent.

