} impl MemoryGas { pub fn new() -> Self { Self { words_num: 0, expansion_cost: 0, } } /// Records an expansion in memory length (number of 32-byte words) /// Returns additional gas cost of the expansion, if any pub fn record_new_len(&mut self, new_num: usize) -> Option<u64> { if new_num <= self.words_num { None // No expansion, no added cost } else { self.words_num = new_num; // Calculate new expansion cost (simplified) let new_cost = new_num as u64 * 3 + (new_num as u64).pow(2) / 512; let cost_diff = new_cost.saturating_sub(self.expansion_cost); self.expansion_cost = new_cost; Some(cost_diff) } }
} The Gas struct calls record_new_len when memory grows and charges the added cost.

